import React from 'react'
import { Link } from 'react-router-dom'

const Header = () => {
  return (
    <div>
        <Link to="/Register">Course details</Link>
        <Link to="/Register">Hostel</Link>
        <Link to="/Register">Events</Link>
        <Link to="/Register"></Link>

    </div>
  )
}

export default Header
